import {GET_PRODUCT,ADD_PRODUCT, INITIALIZE_PRODUCT, SET_PRODUCT} from './Actions'



export const getProduct = ()=>{
    return{
        type: GET_PRODUCT

    }
}
export const addProduct = ()=>{
    return{
        type: ADD_PRODUCT
    }
}
export const initializeProduct = (prod)=>{
    console.log("intialize called argument is",prod)
    return{
        type: INITIALIZE_PRODUCT,
        products:prod}
}
export const setProduct = (prod)=>{
    return{
        type: SET_PRODUCT,
        product:prod
    }
}
